      out.write("		 		claims.setSaveInProgress(false);\r\n");
      out.write("		 		return;\r\n");
      out.write("		 	}		 \r\n");
      out.write("		 	if(r.result==\"Success\"){\r\n");
      out.write("				alert(r.message+\" [No:\"+r.code+\"]\");\r\n");
      out.write("				hideMasterData();\r\n");
      out.write("				return r.key;			\r\n");
      out.write("			}else{\r\n");
      out.write("				claims.setSaveInProgress(false);								\r\n");
