      out.write("		function calculateTotal(){\r\n");
      out.write("			var total=0;\r\n");
      out.write("			var t=screenObjects.getScreenObject(\"claimgrid_data\");\r\n");
      out.write("			var cols=t.getCols();\r\n");
      out.write("			var s=t.getSize();\r\n");
      out.write("			for(var i=0;i<s;i++){\r\n");
      out.write("				total+=toNumber(t.getText(i,cols.approvalamount));\r\n");
      out.write("			}\r\n");
      out.write("			screenObjects.getScreenObject(\"totalamt\").setValue(roundOff(total,2));\r\n");
      out.write("			$(\"#netAmt\").html(\"Total Amount   \"+roundOff(total,2));\r\n");
      out.write("		}\r\n");
      out.write("		function calculateAmount(row){\r\n");
      out.write("			var t=screenObjects.getScreenObject(\"claimgrid_data\");\r\n");
      out.write("			var cols=t.getCols();\r\n");
      out.write("			var pharmacyAmount=0;\r\n");
      out.write("			var nursingAmount=0;\r\n");
      out.write("			var professionalAmount=0;\r\n");
      out.write("			var nursing=toNumber(t.getText(row,cols.nursing))+toNumber(t.getText(row,cols.invest));\r\n");
      out.write("			var professional=toNumber(t.getText(row,cols.professional));\r\n");
      out.write("			var pharmacy=toNumber(t.getText(row,cols.pharmacy));\r\n");
      out.write("			var claimAmt=toNumber(t.getText(row,cols.totalamount));\r\n");
      out.write("			var appAmt=toNumber(t.getText(row,cols.approvalamount));\r\n");
      out.write("			if(t.getText(row,cols.patienttypecode)==\"1\"){\r\n");
      out.write("				if(appAmt>claimAmt){\r\n");
      out.write("					pharmacyAmount=pharmacy;\r\n");
      out.write("					appAmt=appAmt-pharmacy;\r\n");
      out.write("					professionalAmount=professional;\r\n");
      out.write("					appAmt=appAmt-professional;\r\n");
      out.write("					nursingAmount=appAmt;\r\n");
      out.write("				}else{\r\n");
      out.write("					if(appAmt>=pharmacy){\r\n");
      out.write("						pharmacyAmount=pharmacy;\r\n");
      out.write("						appAmt=appAmt-pharmacy;\r\n");
      out.write("					}else{\r\n");
      out.write("						pharmacyAmount=appAmt;\r\n");
      out.write("						appAmt=0;\r\n");
      out.write("					}\r\n");
      out.write("					if(appAmt>0){\r\n");
      out.write("						var nursingPerc=nursing/(claimAmt-pharmacy);\r\n");
      out.write("						nursingAmount=appAmt*nursingPerc;\r\n");
      out.write("						professionalAmount=appAmt-nursingAmount;\r\n");
      out.write("					}\r\n");
      out.write("				}\r\n");
      out.write("				t.setText(row,cols.pharmacyamount,pharmacyAmount);\r\n");
      out.write("				t.setText(row,cols.nursingamount,nursingAmount);\r\n");
      out.write("				t.setText(row,cols.doctoramount,professionalAmount);\r\n");
      out.write("			}else{\r\n");
      out.write("				t.setText(row,cols.nursingamount,appAmt);\r\n");
      out.write("			}\r\n");
      out.write("			//calculate shares	\r\n");
      out.write("		}\r\n");
